SELECT
    (random() * 999)::int + 1,   -- 1000 teams
    'PlayerFirst' || i,
    'PlayerLast' || i,
    date '1985-01-01' + (random() * 12000)::int,
    (ARRAY['Goalkeeper','Defender','Midfielder','Forward'])
        [(random()*3)::int + 1]
FROM generate_series(1,8000) s(i);
SELECT
    (random() * 24)::int + 1,         
    (random() * 4)::int + 1,           
    (random() * 999)::int + 1,        
    (random() * 999)::int + 1,         
    (random() * 999)::int + 1,         
    now() - ((random() * 365 * 24)::int || ' hours')::interval,
    (random() * 6)::int,
    (random() * 6)::int
FROM generate_series(1,5000) s(i);
SELECT
    (random() * 4999)::int + 1,     
    (ARRAY['GOAL','YELLOW_CARD','RED_CARD'])
        [(random() * 2)::int + 1],
    (random() * 7999)::int + 1,    
    (random() * 999)::int + 1,     
    (random() * 120)::int
FROM generate_series(1,20000) s(i);
